    return (
        <div className='row'>
            <h1 className='artogether'>ArTogether</h1>
            <StickyBox offsetTop={20} offsetBottom={20}>
                <div>Sidebar</div>
            </StickyBox>
            <div>Main Content</div>

        </div>
    )
}

export default Sidebar
